'use strict';

(function (Drupal) {
  var windowWidth = function windowWidth() {
    return window.innerWidth || document.documentElement.clientWidth || document.body.clientWidth;
  };

  Drupal.behaviors.gsap_scrollmagic_slideshow = {
    attach: function attach(context) {
      var slides = context.getElementsByClassName('gsap-panel-initial');
      var ww = windowWidth();

      // Do not run if there are no slides or we are on a mobile-width device.
      if (slides.length === 0 || ww < 1024) {
        return;
      }

      var controls = context.getElementsByClassName('slideshow-control');

      // Add classes to pinContainer needed for section wipes.
      var pinContainer = context.getElementById('pinContainer');
      pinContainer.classList.add('pinContainer-initialized');

      var controller = new ScrollMagic.Controller();
      var wipeAnimation = new TimelineMax();
      Array.from(slides).forEach(function (slide, index) {
        slide.classList.add('gsap-panel');
        if (index === 0) {
          return;
        }
        var id = slide.getAttribute('data-slide-id');
        wipeAnimation.add(TweenLite.fromTo('.slide-id-' + id, 1, { y: "100%" }, {
          y: "0%",
          ease: Linear.easeNone,
          onReverseComplete: function onReverseComplete(id) {
            setActiveControl(index - 1, controls);
          },
          onReverseCompleteParams: [id, index],
          onComplete: function onComplete(id) {
            setActiveControl(index, controls);
          },
          onCompleteParams: [id, index]
        }));
      });

      // create scene to pin and link animation
      var scrollScene = new ScrollMagic.Scene({
        triggerElement: "#pinContainer",
        triggerHook: "onLeave",
        duration: "300%"
      }).setPin("#pinContainer").setTween(wipeAnimation)
      // .addIndicators() // add indicators (requires plugin)
      .addTo(controller);

      controller.scrollTo(function (newpos) {
        TweenMax.to(window, {
          scrollTo: { y: newpos, autoKill: false },
          duration: 1
        });
      });

      var setActiveControl = function setActiveControl(index, controls) {
        Array.from(controls).forEach(function (i) {
          if (i.getAttribute('id') === 'slide-control-' + index) {
            i.classList.replace('bg-brightblue-light', 'bg-secondary-400');
            i.classList.replace('h-4', 'h-6');
            i.classList.replace('w-4', 'w-6');
          } else {
            i.classList.replace('bg-secondary-400', 'bg-brightblue-light');
            i.classList.replace('h-6', 'h-4');
            i.classList.replace('w-6', 'w-4');
          }
        });
      };

      Array.from(controls).forEach(function (control, index) {
        control.addEventListener('click', function (e) {
          e.preventDefault();
          var i = this.getAttribute('data-index');

          var pin = context.getElementById('slide-container');
          var winHeight = window.innerHeight;

          controller.scrollTo(pin.getBoundingClientRect().top + window.scrollY + winHeight * i);
        });
      });
    }
  };

  Drupal.behaviors.responsiveProseTables = {
    attach: function attach(context) {

      var tables = context.querySelectorAll('.prose table');

      tables.forEach(function (el, i) {
        if (el.classList.contains('no-responsive')) {
          return;
        }
        var ths = el.querySelectorAll('thead th');
        // Only loop through tables with table headings.
        if (ths.length !== 0) {
          // Loop through table headings and maintain a list of table headings.
          var headings = {};
          ths.forEach(function (el, i) {
            headings[i] = el.textContent;
          });

          var rows = el.querySelectorAll('tr');
          rows.forEach(function (el, i) {
            var tds = el.querySelectorAll('td, th');
            tds.forEach(function (el, i) {
              if (typeof headings[i] !== 'undefined' && headings[i].trim() !== '') {
                el.setAttribute('data-th', headings[i].trim() + ':\xa0');
              }
            });
          });
        }
      });
    }
  };
})(Drupal);;
